import './FoodHeader.scss'
import {Link } from "react-router-dom";
import { grey} from '@mui/material/colors';
import Grid from '@mui/material/Grid';
import SearchIcon from '@mui/icons-material/Search';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import { useState } from 'react';
import { useParams } from "react-router-dom";
const FoodHeader=()=>{
 const [value,setValue]=useState()
 const {FoodList}=
  console.log(useParams())
  return(
  <div className='NavBar'>
    <Grid  justifyContent="center" container spacing={2} >
    <Link   to={`/FoodList`}>
          <button onClick={()=>{setValue(!value)}} className={!value?'active Navbar__Search':'Navbar__Search'}><SearchIcon sx={{ color: grey[900] }} /></button>
    </Link> 
        

    <Link   to={`/FoodList/FavoriteFood`}>
        <button onClick={()=>{setValue(!value)}} className={value?'active Navbar__Search':'Navbar__Search'}><FavoriteBorderIcon sx={{ color: grey[900] }} /></button>
    </Link>
        
    </Grid>
  </div>
  )
}
export default FoodHeader;
